import { Component } from '@angular/core';

@Component({
  selector: 'app-choose',
  templateUrl: './choose.component.html',
  styleUrls: ['./choose.component.css']
})
export class ChooseComponent {

  constructor(){

  }

  typesOfShoes: string[] = ['option 1','option 2', 'option 3', 'option 4'];
}
<mat-radio-group aria-label="Select an option">
  <div *ngFor = "let shoe of typesOfShoes ">
  <mat-radio-button value="1">{{shoe}}</mat-radio-button>
  </div>
</mat-radio-group>
